private String[] getCommandsAsArray() {
	Set commandSet = commandMap.keySet();
	String[] commands = new String[commandMap.size()];
	int i = 0;
	for (Iterator iter = commandSet.iterator(); iter.hasNext();) {
		String	cmd = (String) iter.next();
		commands[i++] = cmd;
	}
	return commands;
}

